 em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"63774","type":"Paragraph"},{"attributes":{},"id":"57897","type":"DataRange1d"},{"attributes":{"text":"&lt;select id=\"16131\" onchange=\"location = this.value;\"&gt;&lt;option&gt;Selecione uma das Op\u00e7\u00f5es a Seguir&lt;/option&gt;&lt;option value=\"BiASiliaioi.html\"&gt;Municipio: Salvador&lt;/option&gt;&lt;option value=\"BiAFiiiaidiaitini.html\"&gt;Municipio: Feira de Santana&lt;/option&gt;&lt;option value=\"BiAVitiriaidioiqiiiti.html\"&gt;Municipio: Vit\u00f3ria da Conquista&lt;/option&gt;&lt;option value=\"BiAIiaiuiai.html\"&gt;Municipio: Itabuna&lt;/option&gt;&lt;option value=\"BiAJiaieiri.html\"&gt;Municipio: Juazeiro&lt;/option&gt;&lt;option value=\"SiEAiaiaiui.html\"&gt;Municipio: Aracaju&lt;/option&gt;&lt;option value=\"SiEIiaiaiaiai.html\"&gt;Municipio: Itabaiana&lt;/option&gt;&lt;option value=\"SiEEitiniii.html\"&gt;Municipio: Est\u00e2ncia&lt;/option&gt;&lt;option value=\"SiELigirioi.html\"&gt;Municipio: Lagarto&lt;/option&gt;&l
